INSERT INTO `misi` (`id`, `misi`) VALUES
(1, '<ol><li>Sebagai&nbsp;sarana&nbsp;untuk&nbsp;menyalurkan&nbsp;tenaga&nbsp;kerja&nbsp;lulusanSMKN&nbsp;4&nbsp;Bojonegoro, ke dunia usaha dan dunia industri baik lokal, regional,&nbsp;maupun&nbsp;internasional</li><li>Sebagai saran lowongan kerja untuk lingkungan SMKN 4 Bojonegoro&nbsp;dan&nbsp;sekitarnya.&nbsp;</li><li>Meningkatkan kerja sama antar BKK dengan forum BKK dan Dinas&nbsp;Tenaga Kerja, Transmigrasi dan Sosial, serta Dinas Pendidikan dan&nbsp;juga&nbsp;pihak-pihak&nbsp;terkait.&nbsp;</li><li>Meningkatkan kerjasama dengan Dunia Usaha dan Dunia Industri atau&nbsp;perusahaan&nbsp;penggunatenaga&nbsp;kerja</li></ol>');
