INSERT INTO `programkerja` (`id`, `programkerja`) VALUES
(1, '<ol><li>Merencanakan program kerja hubungan industri setiap program studi.</li><li>Mengadakan pertemuan dengan Ketua Kompetensi Keahlian tentang penempatan siswa siswi prakerin.</li><li>Mengadakan koordinasi dengan Ketua Kompetensi Keahlian tentang penempatan siswa-siswi Praktek Kerja Lapangan.</li><li>Mengadakan koordinasi dengan Ketua Kompetensi Keahlian tentang guru monitoring.&nbsp;</li><li>Melakukan proses negosiasi dengan DU/DI dan pemerintah sebagai mitra dalam penempatan siswa-siswi Praktek Kerja Lapangan.&nbsp;</li><li>Menjalin kerjasama (MOU) dengan DU/DI dalam :&nbsp;</li></ol><ul><li>Singkronisasi Kurikulum&nbsp;</li><li>Pelatihan</li><li>Penempatan tamatan&nbsp;</li></ul><ol><li>Pemetaan DU/DI&nbsp;</li><li>Menjalin kerjasama dengan Disnaker tentang pelatihan (Magang) dan penempatan tamatan.</li><li>Membuat database penelusuran tamatan baik yang sudah bekerja maupun belum bekerja.</li><li>Membuat mading informasi lowongan kerja.</li><li>Membuat website khusus BKK.</li><li>Membuat Laporan Kegiatan.</li><li>Monitoring dan Evaluasi.</li></ol>');
INSERT INTO `sambutankepalasekolah` (`id`, `nama`, `foto`, `sambutan`) VALUES
(1, 'Drs. SUYONO, M.MPd.', 'kepalasekolah.jpg', '<p>Selamat datang di laman <a href=\"\">bkk-smkn4bojonegoro.sch.id</a>, laman ini disediakan sebagai sumber informasi yang dibutuhkan khususnya oleh warga sekolah dan juga masyarakat secara umum. Melalui laman ini informasi tentang <strong>Bursa Kerja Khusus (BKK)</strong> di <strong>SMK Negeri 4 Bojonegoro</strong> dapat dengan mudah diakses oleh siapapun yang memerlukannya.&nbsp;<br><br>Sebagaimana diketahui bersama, perkembangan teknologi, khususnya teknologi Informasi dan Komunikasi saat ini sudah sedemikian pesat dan merambah ke semua sektor kehidupan tidak terkecuali di dalamnya adalah sektor pendidikan. Internet sebagai salah satu bagian dari perkembangan teknologi informasi dan komunikasi dari hari ke hari menunjukkan perkembangan yang sangat signifikan.&nbsp;<br><br>Melalui internet kita dapat menjumpai aneka referensi, jurnal, maupun hasil penelitian dalam jumlah yang melimpah. Materi-materi yang disajikan di internet cenderung lebih up to date dibandingkan dengan yang disajikan dalam bentuk tertulis/buku. Sehubungan dengan hal tersebut SMK Negeri 4 Bojonegoro berupaya mengoptimalkan penggunaan jaringan internet yang sudah ada di sekolah agar peningkatan mutu sumber daya manusia dan mutu pendidikan dapat segera tercapai.&nbsp;<br><br>Kelebihan lain dari internet adalah dapat menghadirkan informasi yang dibutuhkan tanpa mengenal batas geografis. Para pengguna internet dapat tukar menukar informasi dengan berbagai pihak disegala penjuru dunia dalam waktu singkat dan dengan biaya yang relatif murah. Salah satu fasilitas yang ada di internet yang dapat dipakai untuk tukar-menukar dan berbagi informasi adalah dengan menggunakan website. Untuk itulah website ini dibuat, dengan tujuan agar pihak sekolah dapat menyampaikan informasi tentang dunia pendidikan dan sekaligus menjalin komunikasi antara pihak sekolah dengan guru, orang tua/ wali murid, siswa, alumni, dan stakeholder. Mudah-mudahan dengan optimalisasi penggunaan internet dan website ini, peningkatan mutu pendidikan dan komunikasi global dapat segera terwujud.&nbsp;<br><br>Wassalamualaiakum wr.wb.<br><br>Kepala Sekolah&nbsp;<br><br><br><strong>Drs. SUYONO, M.MPd.</strong></p>');
